script: |
  super -f text -I q11557.spq | sort > q11557.out

inputs:
  - name: q11557.spq
    data: |
      SELECT DISTINCT + - col1 + - ( + ( col2 / 32 ) ) * cor0.col1 * col1 AS col1 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q11557.out
    data: |
      -306
      -31
      -59
